import React from 'react';
import styled from 'styled-components'
//하나의 컴포넌트 생성(재사용)
const headerList= styled.div`
    border:1px solid black;
    height:300px;


`;

const Header = () => {
    return (

            <headerList>
                <ul>
                    <li>메뉴1</li>
                    <li>메뉴2</li>
                </ul>
            </headerList>

    );
};

export default Header;


